	var mask = new cjs.Shape();
	mask._off = true;
	var mask_graphics_0 = new cjs.Graphics().p("A1AJJIAAyRMAqBAAAIAASRg");
	var mask_graphics_14 = new cjs.Graphics().p("A1AJJIAAyRMAqBAAAIAASRg");
